var title_f39_47_40698="Empyema with calcifications";
var content_f39_47_40698=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F56925%7EPULM%2F51245%7EPULM%2F76849%7EPULM%2F71217&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F56925%7EPULM%2F51245%7EPULM%2F76849%7EPULM%2F71217&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 556px\">",
"   <div class=\"ttl\">",
"    Empyema with calcifications",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 536px; height: 256px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Empyema due to previous pneumothorax therapy for cavitary tuberculosis. Left: Chest radiograph shows large right sided pleural mass with a sharp border towards the lung and obtuse angles of interface towards the chest wall. Slight caudad \"drooping\" is visible. Pleural calcifications are present. The lateral costophrenic sulcus is obscured. Right: CT scan shows a large loculated collection of liquid in the right hemithorax with obvious calcifications of the visceral and parietal pleura. Restrictive changes are evident and account for the small size of the right hemithorax. The thickness of the extrapleural fat in the posterolateral aspect of the right hemithorax is increased when compared to the left side. This compensates for the low lung volume on the right side.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Empyema after liver biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 313px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Homogeneous opacification of the right hemithorax with visible pulmonary vessels, the so-called filter effect, typical of a pleural process.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 371px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posteroanterior view of a normal chest radiograph.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Carol M Black, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Empyema after liver biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 319px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Typical characteristics of a pleural mass are shown: a \"one-edged\" mass, sharply marginated against the lung and with obtuse angles of interface towards the chest wall. Slight \"drooping\" of the mass caudad is present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal lateral chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 252px; height: 368px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Steven Weinberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Empyema after liver biopsy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 374px; height: 300px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Posterior accumulation of low attenuation pleural effusion and the compressed atelectatic right lower lobe, forming a higher attenuation wedge-shaped structure. Note the right middle lobe bronchus pointing ventrally and the superior segmental bronchus of the right lower lobe pointing dorsally towards the collapsed lung.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
