"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     GRADE: Grades of Recommendations, Assessment, Development, and Evaluation; RR: risk ratio.",
"     <br>",
"      * This systematic review reports total mortality and includes the most recent trials. Other meta-analyses that utilize individual patient data report relative risk estimates for vascular mortality (RR 0.97, 95% CI, 0.87-1.09), cancer mortality (RR 0.66, 95% CI, 0.50-0.87), and fatal intracranial bleeds (RR 1.73, 95% CI, 0.96-3.13). The risk of a fatal bleed (including extracranial and intracranial) was low (0.3 percent with aspirin and 0.2 percent with control).",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       The 95% CI for the absolute effect includes no benefit of aspirin. We did not rate down for risk of bias, but this was a borderline decision. Three of the trials did not blind patients, caregivers, or outcome adjudicator. Sensitivity analyses in meta-analysis by Raju et al did not show evidence of risk of bias.",
"       <br>",
"        &Delta; Control group risk estimate for 10-year mortality apply to a 60-year-old male and come from population-based data from Statistics Norway. Mortality increases with age (eg, 50-year-old male; 50 deaths per 1000 in 10 years) and is lower in females than in males (eg, 3 percent in women aged 50 years versus 5 percent in men aged 50 years).",
"        <br>",
"         <font class=\"lozenge\">",
"          &loz;",
"         </font>",
"         Risk groups correspond to low risk (5 percent), medium risk (15 percent), and high risk (25 percent) according to the Framingham score (or other risk tool) to estimate 10-year risk.",
"         <br>",
"          &sect; Control group risk estimates in low, moderate, and high cardiovascular risk groups are based on the Framingham score. We have used data from an individual patient data meta-analysis to provide estimated risks for patient-important outcomes not covered by the Framingham risk score. We have also adjusted for 20 percent overestimation associated with Framingham risk score.",
"          <br>",
"           &yen; Of the strokes in the trials, 89 of 682 (13 percent) without aspirin were hemorrhagic and 116 of 655 (18 percent) with aspirin were hemorrhagic.",
"           <br>",
"            &Dagger; In the individual patient data meta-analysis risk for future major bleeding correlated with risk for future cardiovascular events. Therefore, we make the assumption that a patient at low, medium, or high risk of future cardiovascular events (determined by Framingham score) will be at low, medium, or high risk of future major bleeding events, respectively.",
"            <br>",
"             &dagger; The 95% confidence interval for absolute effect borders no benefit of aspirin.",
"             <br>",
"              ** Moderate control group risk estimate derived from meta-analysis by Rothwell et al.",
"              <br>",
"               &bull;&bull; Major extracranial bleeds are usually from the gastrointestinal tract and are most often defined in those requiring transfusion or resulting in death.",
"              </br>",
"             </br>",
